def test_filepath():
    print()
    ctime = time.mktime(time.localtime())
    print(ctime)
    print(int(ctime))
    print(str(int(ctime)))
    path = str("../image/validate_code/canvasElemImg.{}.png").format(ctime)
    print(path)

def test_filepathName():
    print()
    filePath = "../image/validate_code/canvasElemImg.1234.png"

    fileName = os.path.basename(filePath)
    print("fileName", fileName)

    fileDir = os.path.dirname(filePath)
    print("fileDir", fileDir)

    fileNameData = fileName.split(".")
    fileNameName = str(".").join(fileNameData[:-1])
    fileNameExt = fileNameData[-1]
    print("fileNameData:", fileNameData)
    print("fileNameName:", fileNameName)
    print("fileNameExt:", fileNameExt)

    newFileName = str("{}.{}.{}").format(fileNameName, "cv", fileNameExt)

    newFilePath = os.path.join(fileDir, newFileName)
    print("newFilePath", newFilePath)
